import React from "react";
import styled from "styled-components";
import { Button } from "../pages/Contact";

const CardBox = styled.div`
  width: 300px;
  height: 300px;
  background-color: #ededed;
  display: flex;
  flex-direction: column;
`;

const Title = styled.h1`
  height: 50px;
  font-size: 12px;
  margin: 0 auto;
  text-align: center;
  margin-top: 20px;
`;

const Image = styled.img`
  height: 150px;
  width: 100%;
`;

const Desc = styled.p``;

const ButtonPosition = styled.div`
  margin: 0 auto;
  display: flex;
  gap: 10px;
`;

function Card({ id, title, img, data }) {
  return (
    <CardBox>
      <Title>{title}</Title>
      <Image src={img}></Image>
      <Desc></Desc>
      <ButtonPosition>
        <Button>Edit</Button>
        <Button>Delete</Button>
      </ButtonPosition>
    </CardBox>
  );
}

export default Card;
